import logo from "../assets/images/logo.svg";
import main from "../assets/images/main.svg";
import server from "../assets/images/server.svg";
import { Link } from "react-router-dom";
import Wrapper from "../assets/wrappers/LandingPage";

const Landing = () => {
  return (
    <Wrapper>
      <nav>
        <img src={logo} alt="eniac" className="logo" />
      </nav>
      <div className="container page">
        <div className="info">
          <h2>
            ENIAC, Your <span>First</span> PaaS
          </h2>
          <img src={server} alt="eniac paas" className="img main-img"/>
          <p>
            I'm baby williamsburg pinterest cardigan neutra gastropub. VHS fit
            cred, umami subway tile blue bottle succulents kickstarter bespoke.
            Master cleanse glossier taxidermy, cardigan heirloom letterpress paleo
            hoodie cronut authentic bruh craft beer. Stumptown roof party
            gastropub fashion axe cred, banjo everyday carry. Vegan celiac
            thundercats, schlitz 90's poutine hot chicken keytar.
          </p>
          <Link to='/register' className="btn btn-hero">
            Login/Register
          </Link>   
        </div>
        <img src={main} alt="eniac paas" className="img main-img"/>
      </div>
    </Wrapper>
  );
};
export default Landing;
